import React from 'react';



function importAll(r) {
    return r.keys().map(r);
  }

function CardContainer(props) {
    console.log(props.path.toString())
    let path="./../images/things/"
    const listOfImages=importAll(require.context('${path}', false, /\.(png|jpe?g|svg)$/));
    console.log({props})
    return (
        <div>
        {listOfImages.map(
            (image,index) =>  <img key={index} src={image.default} alt="info"></img>
        )}
        </div>
    );
}

export default CardContainer;
